import React from "react";

const Footer=()=>{
    return(
        <>
            <div className="container">
                <div className="row">
                    <div className="col-12 text-center bg-dark text-white">
                        <h3>This is Hafiz Umer Farooq Site @Copyright Not Available</h3>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Footer;
